import React, { Component } from 'react';
import logo from '../img/logo.png';
import { Navbar, NavItem, NavDropdown, MenuItem, Nav } from 'react-bootstrap';
class Header extends Component {
  render() {

    if(this.props.data){
      var name = this.props.data.name;
      var description= this.props.data.description;
      var networks= this.props.data.social.map(function(network){
        return <li key={network.name}><a href={network.url}><i className={network.className}></i></a></li>
      })
    }

    return (
      <header id="home">


      <>
      <Navbar bg="dark" variant="dark">
         <Navbar.Brand href="#home">WhereMyHeartIs</Navbar.Brand>
         <Nav className="mr-auto">
         <Nav.Link className="smoothscroll" href="#home">Home</Nav.Link>
         <Nav.Link className="smoothscroll" href="#About Game">About Game</Nav.Link>
         <Nav.Link className="smoothscroll" href="#Demo">Demo</Nav.Link>
         <Nav.Link className="smoothscroll" href="#Download">Download</Nav.Link>
         <Nav.Link className="smoothscroll" href="#Contact">Contact</Nav.Link>
      </Nav>
         <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-info">Search</Button>
         </Form>
      </Navbar>


   </>
      <div className="row banner">
         <div className="banner-text">
            <img src={logo} alt="Logo" />
            <h3> {description}.</h3>
            <hr />
            <ul className="social">
               {networks}
            </ul>
         </div>
      </div>

      <p className="scrolldown">
         <a className="smoothscroll" href="#about"><i className="icon-down-circle"></i></a>
      </p>

   </header>
    );
  }
}

export default Header;
